import Link from 'next/link';

const Home = () => {
  return (
    <ul>
      <li>
        <Link href="/">
          <a>Home</a>
        </Link>
      </li>
      <li>
        <Link href="/users">
          <a>About Us</a>
        </Link>
      </li>
    </ul>
  );
};

export default Home;
